def build_lookup_tables(language_rows, script_rows):
    """Return dictionaries for O(1) lookups by language or script id."""
    script_map = {row[0]: row for row in script_rows}
    language_map = {}
    for name, start, end, script_id in language_rows:
        language_map[name] = (start, end, script_map.get(script_id))
    return language_map, script_map

def build_codepoint_table(language_rows=LANGUAGE_RANGES):
    table = array('H', [0]) * MAX_CODEPOINT
    for idx, (_name, start, end, _script_id) in enumerate(language_rows, start=1):
        upper = min(end, MAX_CODEPOINT - 1)
        lower = max(0, start)
        for codepoint in range(lower, upper + 1):
            table[codepoint] = idx
    return table

_STYLE_SUFFIX = {
    "regular": "Regular",
    "bold": "Bold",
    "italic": "Italic",
    "bolditalic": "BoldItalic",
}

def build_cdn_url(family_name, style="regular", build="full", flavor="otf"):
    """Construct the CDN URL for a given Noto family and style."""
    style_key = _STYLE_SUFFIX.get(style.lower(), style)
    family_dir = re.sub(r"[^0-9A-Za-z]", "", family_name)
    filename = f"{family_dir}-{style_key}.{flavor}"
    return (
        "https://cdn.jsdelivr.net/gh/notofonts/notofonts.github.io/fonts/"
        f"{family_dir}/{build}/{flavor}/{filename}"
    )
